import React from "react"
import "./App.css"
import Logo from "./assets/img/logo.png";

const App = () => {
  return (
    <>
      <div className="card">
        <img src = {`${Logo}`}/>
        <h1>THINGS TO DO..</h1>
        <small>During Bootcamp With Sanbercode</small>
        <hr/>
      </div>
      <div className="list-card">
        <input type={'checkbox'}/> BELAJAR GIT & CLI
      </div>
    </>
  );
}

export default App;
